import React from "react";
import { MapContainer, TileLayer, useMap, Marker, Popup, ImageOverlay } from 'react-leaflet'
import 'leaflet/dist/leaflet.css';
import { LatLngBounds, Map, CRS, Icon } from "leaflet";
import "./Carte.css"

export default function Carte () {

    const customIcon = new Icon({
        iconUrl: "/images/icons/pin-scene.svg",
        iconSize: [35, 35]
    });

    const bounds = new LatLngBounds([0, 0], [500, 1000]);



    const [mapData, setMapData] = React.useState();

    






    return(
        <div id="map">

            <MapContainer center={[250, 500]} zoom={0} maxZoom={3} scrollWheelZoom={true} crs={CRS.Simple}>
                <ImageOverlay
                    url="http://drupal10/sites/default/files/2023-08/Capture%20d%27%C3%A9cran%202023-08-30%20175241.png"
                    bounds={bounds}
                    zIndex={10}                  
                />
                <Marker position={[220, 220]} icon={customIcon}>
                </Marker>
                <Marker position={[400, 580]} icon={customIcon}>
                </Marker>  
                <Marker position={[140, 350]} icon={customIcon}>
                </Marker>  
                <Marker position={[200, 550]} icon={customIcon}>
                </Marker> 
                <Marker position={[220, 180]} icon={customIcon}>
                </Marker>
                <Marker position={[420, 580]} icon={customIcon}>
                </Marker>  
                <Marker position={[140, 200]} icon={customIcon}>
                </Marker>  
                <Marker position={[200, 750]} icon={customIcon}>
                </Marker>     
            </MapContainer>
            

        </div>
    );
}
